import {icons} from '../constants'
export const categories = [

    {
        id:1,
        name:'BCS STUDY',
        icon:icons.bcs
    },
    {
        id:2,
        name:'BANK JOB',
        icon:icons.bank
    },
    {
        id:3,
        name:'IQ TEST',
        icon:icons.light
    },
    {
        id:4,
        name:'MODEL TEST',
        icon:icons.board
    },
    {
        id:5,
        name:'IT QUESTIONS',
        icon:icons.tech
    },
    {
        id:6,
        name:'INTERNATIONAL',
        icon:icons.glob
    }

]

export const bankCategories = [
    {
        id:1,
        name:'Combine Bank Preparation'
    },
    {
        id:2,
        name:'Bangladesh Bank'
    },
    {
        id:3,
        name:'Private Bank',
    }
]

export const modelTestCategories = [
    {
        id:1,
        name:'Bcs Model Test',
        icon:icons.bcstest
    },
    {
        id:2,
        name:'Combine Bank Test',
        icon:icons.combine
    },
    {
        id:3,
        name:'Bangladesh Bank Test',
        icon:icons.bdbank
    },
    {
        id:4,
        name:'Private Bank Test',
        icon:icons.privatebank
    },
    {
        id:5,
        name:'Random Test',
        icon:icons.random
    }
]
